  { name: "Node.js", experience: "1.5 years" },
  { name: "React.js", experience: "1 year" },
  { name: "Express.js", experience: "1.5 years" },
  { name: "PostgreSQL", experience: "1 year" },
  { name: "Raspberry Pi", experience: "3 months" },
  { name: "Arduino UNO", experience: "3 months" },
];

export default frameworks;
